import React from "react";
import { Flag, Segment } from "semantic-ui-react";

/* import "./globalStyle.css"; */

class Cell extends React.Component {
  render() {
    const obj = { code: "ca", name: "Canada" };
    const { code, name } = obj;
    return (
      <div>
        <Flag name={code} />
        <div id={`fuso_${code}`} />
        <h5>{name}</h5>
        <div className="row">
          <img
            id="canada_news"
            src="src/newspaper.png"
            className="api_icon news"
            alt="icon_newspaper"
          />
          <img
            id="weather_ca"
            /* onClick="weather(45.376296, -75.651582)" */
            className="api_icon"
            src="src/weather.png"
            alt="weather_icon"
          />
          <img
            id="twitter_ca"
            /* onClick="twitter(45.376296, -75.651582)" */
            className="api_icon"
            src="/src/twitter.png"
            alt="icon_twitter"
          />
          <img
            id="youtube_ca"
            /* onClick="youtube('ca')" */
            className="api_icon"
            src="src/youtube.png"
            alt="icon_youtube"
          />
        </div>
      </div>
    );
  }
}

export default Cell;
